El Massa-Kirchnerismo representa una amenaza: 

1. A la integridad económica e institucional (son banda de corruptos y lavadores);

2. A la seguridad nacional (amigos de Irán, Rusia, China, y el eje Castro-Chavista);

3. A la estabilidad democrática (defensores de las dictaduras latinoamericanas y profesionales de las violaciones de veda, el clientelismo, el fraude electoral, y el financiamiento narco de la política);

4. Al Estado de Derecho y la continuidad de la República (desprecian la división de poderes, aprietan y corrompen a fiscales y jueces, ignoran los fallos judiciales, imponen su voluntad por la fuerza).

5. A las libertades individuales (odian que puedas decidir libremente tu proyecto de vida y la búsqueda de tu felicidad, que puedas informarte y educarte libremente y pensar distinto a ellos, que puedas elegir por tu cuenta).

Esto ya lo sabemos. Es lo que son y nos vienen demostrando ser desde hace décadas. No hay incertidumbre al respecto. Por todo ello, resulta inaceptable y moralmente reprochable quedarse de brazos cruzados permitiendo que esta mafia se perpetúe en el poder. 

Nada, absolutamente nada, justifica en el contexto actual la indiferencia, pasividad, o supuesta neutralidad, pudiendo anticipar como consecuencia posible de dichas posturas la cooptación del poder a perpetuidad por parte de estos delincuentes.
